        world.announce("6", "cn"); // ; Chinese
        world.runExecution();



		
        if(world.isExecutableBy(me)){
            you.setExecution(me.toExecution());
        }


		
        if(world.getThingIndex(you) != -1){
            world.runExecution();
        }

		

        me.escape(world);



        me.learnTopic("love");
		


        me.takeExamTopic("love");
		


        me.getAlgebraicExpression("love");
		


